import React, { lazy } from 'react';
import Wedding from './Main/Wedding';
import { PAGES } from '../Constants';
const RSVP = lazy(() => import('./Main/RSVP'));
const Travel = lazy(() => import('./Main/Travel'));

function Main(props) {
  return (
    <div className="main">
      {
        props.screen === PAGES.RSVP ?
          <RSVP name={props.name}
            auth={props.auth}
            setResponse={props.setResponse}
            response={props.response} /> :
          props.screen === PAGES.WEDDING ? <Wedding /> :
            props.screen === PAGES.TRAVEL ? <Travel /> : null
      }
    </div>
  )
}

export default Main;
